import React, { Component } from 'react';
import PropTypes from 'prop-types';
import {
  BrowserRouter as Router,
  Route,
  Link
} from 'react-router-dom';
const handleToSearch=() => {
  if(this.state.keyword){
      this.context.router.history.push(`/../gooddetails`)
  }
}
export default class Header extends Component {
    static contextTypes = {
        router: PropTypes.object.isRequired,
    }
    constructor(props) {
        super(props);
        this.state = {
            keyword:"",
            channelList:[]
        };
        
    }
    
    render() {
        return (
          <div>
          <Router> 
            <Link key={1} to={'/../gooddetails'} target="_blank">sss</Link>
          </Router>
         <h3 onClick={handleToSearch()}>sdf</h3>
         </div>
        );
    }
}
